Gumi (; ) is a rural locality (a selo) in Guninsky Selsoviet, Tabasaransky District, Republic of Dagestan, Russia. Population:  There are 3 streets.
Geography
Gumi is located 20&nbsp;km southwest of Khuchni (the district's administrative centre) by road. Afna is the nearest rural locality.
